import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { AppBar, ThemeProvider } from '@material-ui/core';
import "./Card.css"

import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';

import InputBase from '@material-ui/core/InputBase';

const useStyles = makeStyles({


});

export const MuiCard = () => { 
  const classes = useStyles();


  return (

    <div>
    <Card className={classes.root}>

        <Typography className={classes.title} >
          Employee Payroll Form 

        </Typography>
        <Typography className={classes.name} > Name       
        <input classname = {classes.input} type="text" id="message" name="message"/>
        <div>Profile image
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 
        <input type="radio"  name="gender" /> 

      </div>
        <div>Gender
        <input type="radio" value="Male" name="gender" /> Male
        <input type="radio" value="Female" name="gender" /> Female

      </div>
      <div>Salary
      <FormControl className={classes.formControl}>
        <InputLabel className={classes.input} htmlFor="uncontrolled-native" placeholder="Select Salary"></InputLabel>
        <NativeSelect></NativeSelect>
      </FormControl>
         </div>

         <div>StartDate
         <FormControl className={classes.name}>
        <InputLabel id="demo-customized-select-label"></InputLabel>
        <Select
          labelId="demo-customized-select-label"
          id="demo-customized-select"

        >
          <MenuItem value={10}>Day</MenuItem>

        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel id="demo-customized-select-label"></InputLabel>
        <Select
          labelId="demo-customized-select-label"
          id="demo-customized-select"

        >
          <MenuItem value={10}>Month</MenuItem>

        </Select>
      </FormControl>
      <FormControl className={classes.formControl}>
        <InputLabel id="demo-customized-select-label"></InputLabel>
        <Select
          labelId="demo-customized-select-label"
          id="demo-customized-select"

        >
          <MenuItem value={10}>Year</MenuItem>

        </Select>
      </FormControl>
      </div>


        </Typography>



    </Card>
    </div>


  );
}
